import React from 'react'
import {NavLink} from 'react-router-dom'

const NavBar = () => {
    return (
        <div>
            <NavLink to ='/home'>Home</NavLink>
            <NavLink to ='/activity'>Activity</NavLink>
        </div>
    )
}

export default NavBar
